import React, {Component, Fragment} from "react";
import {withRouter} from "react-router-dom";
import Remind from "../Remind/Remind";
import ANPUT from "../input/Input";
import Noviceguide from "../../so-so/Noviceguide/Noviceguide";
import Dailysignin from "../../so-so/Dailysignin/Dailysignin";
import Cookbook from "../../so-so/Cookbook/Cookbook"
import BakingEncyclopedia from "../../so-so/BakingEncyclopedia/BakingEncyclopedia";
import Schoolselection from "../../middle/Schoolselection/Schoolselection";
import Homepage from "../../bottom/Homepage/Homepage";
import Videoschool from "../../bottom/Videoschool/Videoschool";
import Bakingcircle from "../../bottom/Bakingcircle/baking";
import My from "../../bottom/My/My";
class Addto extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    addto=()=>{
        this.props.history.push('/Addto')
        console.log(this.props)
    }
    render() {
        return (<Fragment>
                <div className={"top"}>
            <div className={"Addto"}>
                <img alt={"标本"} onClick={this.addto} className={"addtoimg"} src={"https://image.hongbeibang.com/Fj1u8rBVnt5DLwXqhx8QKlRPLoGI?48X48&imageView2/1/w/48/h/48"} />
            </div>
                <ANPUT/>
                <Remind/>
                </div>
                <div className={"soso"}>
                    <Noviceguide/>
                    <Dailysignin/>
                    <Cookbook/>
                    <BakingEncyclopedia/>
                </div>
                <div className={"middle"}>
                <Schoolselection/>
                </div>
                <div className={"bottom"}>
                <Homepage/>
                <Videoschool/>
                <Bakingcircle/>
                    <My/>
                </div>
            </Fragment>
        )
    }
    // async componentDidMount(){
    //     const data=await this.$axios.get("/education/getIndexByWeb?_t=1587652028284")
    //     console.log(data)

        // this.setState({
        //     src:data.data.category[0].item[0].image,
        // })
        // this.setState({
        //     title:data.data.category[0].title
        // })
    // }

}
export default withRouter(Addto);
